    const { id: productId } = useParams();
    const product = products.find((product) => product._id === productId);
    console.log(product);
    return (
        <>
            <Link className="btn btn-light my-3" to="/">
                Go Back
            </Link>
        </>
    );
};

export default ProductScreen;
